import React from "react";
import {getData,codes} from '../data/services';
import { Link,Outlet } from "react-router-dom";

export const ServicesList=()=>{
  
    return (<div>
      <ul>
      {codes.map((s) => (
        <li key={s.id}>
          {" "}
          <Link to={`/ServicesList/${s}`}> {getData(s).name} </Link>{" "}
        </li>
      ))}
    </ul>
    <Outlet />
  </div>)
}
